import React from 'react';
import styled from "@emotion/styled";

const Titulo = styled.h1`
    margin-top: 5rem;
    text-align: center;
`;

const Error404 = () => {
    return ( 
        <h1>Producto no existente</h1>
     );
}
 
export default  Error404;
